function Forecast({ forecast }) {
    // console.log(forecast.currentForecast)
    // console.log(forecast.currentForecastDetails)


  return (
    <div className="forecast__container">
        { 
    Object.keys(forecast.currentForecast).map((item, i) => (
        <li className="travelcompany-input" key={i}>
            <span className="input-label">{ forecast.currentForecast[item] }</span>
        </li>
    ))
}  
    </div>
  )
}

export default Forecast;
